import React from "react"

import Maze from "./Maze"
import generateMaze from "./generateMaze"

import "./App.css"

const maze = generateMaze()

export default class App extends React.Component {
  render(){
    return (
    <div className="App">
      <Maze maze={maze} />
    </div>
    )
  }
}

